column8:
BRIDEが新たなコンセプトで開発した【ZODIA（ゾディア）】は、ロータス・エリーゼ/エキシージ等コクピットが非常にタイトで、ローポジション化が難しく、なおかつスポーツ走行ではホールド性に不満がある多くのユーザーのリクエストに答えたモデルです。これは、国産車のカプチーノ、ビート等のオープンコンパクトスポーツカーにもあてはまり、取り付けのシートレールを専用設計することで、装着を可能としました。今まで不可能とされていたビート、カプチーノの3０ミリ以上のローポジション化を実現しました。<br><br>●FRP製 ●カラー：ブラック ●ZODIAを装着するにはZODIA専用シートレールZFタイプが必要です。（※取り付け幅が異なるため、他のレールでは使用できません） ●ZODIAは競技用モデルのため、シートバックプロテクターの設定はございません。 ●日本製 ●重量：約5.5kg ●競技用モデル ●納期：この商品は受注生産品のためご注文後、通常7～10日後出荷予定です。（※通常納期を著しく超える場合は別途ご連絡させて頂きます）<br><br>※競技用モデルのため、一般公道での使用は絶対しないでください。<br><br>汎用品<br><br><br><br>インテリア | シート<tr><td colspan="2">
